import express from 'express';
const router = express.Router();

// Importar el modelo nota
import primer_bd from '../models/primer_bd';

// Agregar un registro

router.post('/nuevo-registro', async(req,res)=>{
    const body = req.body;

    try {
        const primer_bd_body = await primer_bd.create(body);
        res.status(200).json(primer_bd_body);
    } catch (error) {
        return res.status(500).json({
            mensaje: 'Ocurrio algo inesperado',
            error
        })
    }
});

// Exportar la configuración de express

module.exports=router;

