import mongoose from 'mongoose';
const Schema = mongoose.Schema;

const customers_schema = new Schema({
    username: {type: String, required:[true, 'Username requeried']},
    password: {type: String, required:[true, 'Password requeried']},
    name: String,
    email: String,
    address: String,
    phone_number: String,
    created_at: {type: Date, default:Date.now},
    customer_reliability: {type: Number , default:0.7},
    active_user: {type: Boolean, default:true}
 });


 const services_schema = new Schema({
   service_name: {type: String, required:[true, 'Username requeried']},
   service_description: String,
   cost_per_hour: {type: Number, required:[true, 'Username requeried']},
   rating: {type: Number , default:0.7}
 });


 const employees_schema = new Schema({
    username: {type: String, required:[true, 'Username requeried']},
    password: {type: String, required:[true, 'Password requeried']},
    name: String,
    email: String,
    address: String,
    phone_number: String,
    created_at: {type: Date, default:Date.now},
    employee_reliability: {type: Number , default:0.7},
    employee_description: String,
    time_available: String,
    experience: String,
    services: {
      type: services_schema,
      default: {}
    } 
 });

 const customerBD = mongoose.model('customers', customers_schema);
 const employeesBD = mongoose.model('employees', employees_schema);
